import React from "react";
import {motion} from "framer-motion";

export default function boxAnimation(){
    return(
        <div className="box" 
        initial={{ marginLeft:-10 }}
        whileInView={{marginLeft:100 }}
        exit={{marginLeft:-10}}
        transition={{ duration: 0.7 }}
        
        />
    )
}
